/** 
 * Helper method to startup a bookie server using a configuration object. Also, starts the auto recovery process if isAutoRecoveryEnabled is true.
 * @param conf Server Configuration Object
 */
protected BookieServer startBookie(ServerConfiguration conf) throws Exception {
  BookieServer server=new BookieServer(conf);
  bsConfs.add(conf);
  bs.add(server);
  server.start();
  if (bkc == null) {
    bkc=new BookKeeperTestClient(baseClientConf);
  }
  int port=conf.getBookiePort();
  while (!metadataStore.exists("/ledgers/available/" + InetAddress.getLocalHost().getHostAddress() + ":"+ port).join()) {
    Thread.sleep(500);
  }
  bkc.readBookiesBlocking();
  LOG.info("New bookie on port " + port + " has been created.");
  return server;
}
